import axios from 'axios'
import React, { useEffect, useState } from 'react'


const HomePage = () => {


    useEffect(() => {
        axios.get(`https://striveschool-api.herokuapp.com/api/posts/`,
            {
                headers: {
                    Authorization:
                        " Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MTFlNGYyYTA2MTBjYjAwMTVkYTJhOGYiLCJpYXQiOjE2MzI3NDEyODMsImV4cCI6MTYzMzk1MDg4M30.YMaDdC-l79VEcfSSUgg0XQVA_Xju8ob5EXPPxNY2uXA",
                },

            })
            .then(function (response) {
                console.log(response);
            })
            .catch(function (error) {
                console.log(error);
            });
    }, [])


    return (
        <>


            <div className="flex mx-auto justify-center border my-3" >
                <h4>Mynavbar</h4>
            </div>
            <div className="flex flex-wrap justify-around my-3">

                <div className="border" >
                    <h4>sidebarleft</h4>
                </div>
                <div className="border" >
                    <h4>Feeds</h4>

                </div>
                <div className="border" >
                    <h4>sidebarright</h4>
                </div>
            </div>
            <div className="flex mx-auto flex-col justify-center border my-3" >
                <h4>footer</h4>
            </div>

        </>
    )
}

export default HomePage
